import React from "react";
import EmployersListItem from "../EmployersListItem/EmployersListItem";
import "./EmployersList.css"

function EmployerList ({data}){
    const elements = data.map(item => {
        return (
            <EmployersListItem name={item.name} salary={item.salary} increase={item.increase}/>
            // <EmployersListItem {...item}/>
        )
    })
    return(
     <ul className="appList listGroup">
        {elements}
     </ul>
    )
}
export default EmployerList;
